E_FILE_MACOS \\\n-derivedDataPath $DERIVED_DIR \\\nSKIP_INSTALL=NO BUILD_LIBRARY_FOR_DISTRIBUTION=YES\n\n# xcframework作成\nxcodebuild -create-xcframework \\\n-framework $ARCHIVE_FILE_IOS/Products/Library/Frameworks/${PROJECT_NAME}.framework \\\n-framework $ARCHIVE_FILE_IOS_SIMULATOR/Products/Library/Frameworks/${PROJECT_NAME}.framework \\\n-framework $ARCHIVE_FILE_IOS_MACCATALYST/Products/Library/Frameworks/${PROJECT_NAME}.framework \\\n-framework $ARCHIVE_FILE_MACOS/Products/Library/Frameworks/${PROJECT_NAME}.framework \\\n-output $XCFRAMEWORK_DIR/${PROJECT_NAME}.xcframework\n\n# SPM配布用にxcframeworkを格納するディレクトリ\nPRODUCT_FRAMEWORK_DIR=${PROJECT_DIR}/../Frameworks\n\nrm -rf ${PRODUCT_FRAMEWORK_DIR}\nmkdir -p ${PRODUCT_FRAMEWORK_DIR}\n\n# xcframeworkを配布用ディレクトリに移動\nmv ${XCFRAMEWORK_DIR}/${PROJECT_NAME}.xcframework ${PRODUCT_FRAMEWORK_DIR}\n\n# xcframeworkの出力ディレクトリをFinderで開く\nopen ${PRODUCT_FRAMEWORK_DIR}\n\n# 中間ディレクトリを削除\nrm -rf ${OUTPUT_DIR}\n";
